Ext.data.JsonP['Titanium_SDK_5.0.2_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Titanium SDK 5.0.2 General Availability - 1 October 2015</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46239773\" class=\"content\">\n                        <h1>Titanium SDK 5.0.2 General Availability - 1 October 2015</h1>\n    <div class=\"section section-2 \" id=\"src-46239773_TitaniumSDK5.0.2ReleaseNote-Contents\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.0.2_Release_Note-section-src-46239773_TitaniumSDK5.0.2ReleaseNote-AboutThisRelease\">About This Release</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.0.2_Release_Note-section-src-46239773_TitaniumSDK5.0.2ReleaseNote-FixedIssues\">Fixed Issues</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_5.0.2_Release_Note-section-src-46239773_TitaniumSDK5.0.2ReleaseNote-APIChanges\">API Changes</a>    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46239773_TitaniumSDK5.0.2ReleaseNote-AboutThisRelease\">\n        <h2 class=\"heading \"><span>About This Release</span></h2>\n    <p>Titanium SDK 5.0.2 is a patch release of the SDK, addressing high-priority issues from previous releases.    </p>\n    <p>    <span id=\"src-46239773_issues\"><a name=\"src-46239773_issues\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46239773_TitaniumSDK5.0.2ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19643\" target=\"_blank\">TIMOB-19643</a> CLI: Runtime error when no DefaultIcon.png exists    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19616\" target=\"_blank\">TIMOB-19616</a> Changes to app content are not updated on rebuild to device    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19612\" target=\"_blank\">TIMOB-19612</a> Changes to Classic / Alloy apps are not updated on rebuild    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19594\" target=\"_blank\">TIMOB-19594</a> iOS: Cannot build iOS Modules since 5.0.0.GA TiSDK    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-19562\" target=\"_blank\">TIMOB-19562</a> iOS: Ti.Network connecting to pubnub service crashes on ios9 devices    </p>\n</li></ul>    <p>    <span id=\"src-46239773_apichanges\"><a name=\"src-46239773_apichanges\"/></span>\n    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-46239773_TitaniumSDK5.0.2ReleaseNote-APIChanges\">\n        <h2 class=\"heading \"><span>API Changes</span></h2>\n    <p>No APIs were modified for this release.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46239773\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Titanium SDK 5.0.2 Release Note"});